import React from 'react';
import NavCss from './Nav.module.css';


const Nav = () => {
    return (
        <nav className={NavCss.nav}>
            <a href="#">Profile</a>
            <br></br>
            <a href="#">Messages</a>
            <br></br>
            <a href="#">Music</a>
            <br></br>
            <a href="#">Settings</a>
            HiperNav
        </nav>
    );
}

export default Nav;
